// SPDX-License-Identifier: GPL-3.0
pragma solidity > 0.8.0 < 0.9.0;

contract GlobalStorage {

    // Безопасность:

    address ownerContract;
    address[] logicContracts;

    // Данные пользователей:

    mapping (bytes32 => string) internal stringDataUser;
    mapping (bytes32 => string[]) internal stringArrayDataUser;

    mapping (bytes32 => address) internal addressDataUser;
    mapping (bytes32 => address[]) internal addressArrayDataUser;

    mapping (bytes32 => uint8) internal uint8DataUser;
    mapping (bytes32 => uint8[]) internal uint8ArrayDataUser;
    mapping (bytes32 => uint16) internal uint16DataUser;
    mapping (bytes32 => uint16[]) internal uint16ArrayDataUser;
    mapping (bytes32 => uint) internal uintDataUser;
    mapping (bytes32 => uint[]) internal uintArrayDataUser;

    mapping (bytes32 => bytes32) internal bytes32DataUser;
    mapping (bytes32 => bytes32[]) internal bytes32ArrayDataUser;

    mapping (bytes32 => bool) internal boolDataUser;
    mapping (bytes32 => bool[]) internal boolArrayDataUser;

    // Данные проекта:

    mapping (bytes32 => string) internal stringDataProject;
    mapping (bytes32 => string[]) internal stringArrayDataProject;

    mapping (bytes32 => address) internal addressDataProject;
    mapping (bytes32 => address[]) internal addressArrayDataProject;

    mapping (bytes32 => uint8) internal uint8DataProject;
    mapping (bytes32 => uint8[]) internal uint8ArrayDataProject;
    mapping (bytes32 => uint16) internal uint16DataProject;
    mapping (bytes32 => uint16[]) internal uint16ArrayDataProject;
    mapping (bytes32 => uint) internal uintDataProject;
    mapping (bytes32 => uint[]) internal uintArrayDataProject;

    constructor() {
        ownerContract = msg.sender;
        logicContracts.push(msg.sender);
    }


    // Модификаторы доступа:

    modifier onlyContract() {
        bool flag = false;
        for (uint16 i = 0; i < logicContracts.length; i++){
            if (msg.sender == logicContracts[i]) {
                flag = true;
                break;
            }
        }
        require(flag);
        _;
    }


    // Вспомогательные функции просмотра данных:

    function getAddressesContracts() public view returns (address[] memory) {
        return logicContracts;
    }

    function getOwnerContract() public view returns(address) {
        return ownerContract;
    }

    // Вспомогательные функции:

    function addAddressContract(address _newAddressContract) public onlyContract() {
        require(msg.sender == ownerContract);
        logicContracts.push(_newAddressContract);
    }

    function changeOwnerContract(address _newAddressContract) public onlyContract() {
        require(msg.sender == ownerContract);
        ownerContract = _newAddressContract;
    }

    function delAddressContract(address _oldAddress) public onlyContract() {
        require(msg.sender == ownerContract);
        for (uint16 i = 0; i < logicContracts.length; i++){
            if (logicContracts[i] == _oldAddress){
                logicContracts[i] = address(0);
                break;
            }
        }
    }


    // Просмотр данных пользователей:
    // Строки:
    function getStringDataUser(bytes32 _key) external view returns (string memory) {
        return stringDataUser[_key];
    }

    function getStringArrayDataUser(bytes32 _key) external view returns (string[] memory) {
        return stringArrayDataUser[_key];
    }
        
    // Адреса:
    function getAddressDataUser(bytes32 _key) external view returns (address) {
        return addressDataUser[_key];
    }

    function getAddressArrayDataUser(bytes32 _key) external view returns (address[] memory) {
        return addressArrayDataUser[_key];
    }

    // Числа:
    function getUint8DataUser(bytes32 _key) external view returns (uint8) {
        return uint8DataUser[_key];
    }

    function getUint8ArrayDataUser(bytes32 _key) external view returns (uint8[] memory) {
        return uint8ArrayDataUser[_key];
    }


    function getUint16DataUser(bytes32 _key) external view returns (uint16) {
        return uint16DataUser[_key];
    }

    function getUint16ArrayDataUser(bytes32 _key) external view returns (uint16[] memory) {
        return uint16ArrayDataUser[_key];
    }


    function getUintDataUser(bytes32 _key) external view returns (uint) {
        return uintDataUser[_key];
    }

    function getUintArrayDataUser(bytes32 _key) external view returns (uint[] memory) {
        return uintArrayDataUser[_key];
    }

    // Байты:
    function getBytes32DataUser(bytes32 _key) external view returns (bytes32) {
        return bytes32DataUser[_key];
    }

    function getBytes32ArrayDataUser(bytes32 _key) external view returns (bytes32[] memory) {
        return bytes32ArrayDataUser[_key];
    }

    // Bool:
    function getBoolDataUser(bytes32 _key) external view returns (bool) {
        return boolDataUser[_key];
    }

    function getBoolArrayDataUser(bytes32 _key) external view returns (bool[] memory) {
        return boolArrayDataUser[_key];
    }

    // Изменение данных пользователей:
    // Строк:
    function setStringDataUser(bytes32 _key, string memory _newString) external {
        stringDataUser[_key] = _newString;
    }

    function setStringArrayDataUser(bytes32 _key, uint16 _num, string memory _newString) external {
        stringArrayDataUser[_key][_num] = _newString;
    }

    function setFullStringArrayDataUser(bytes32 _key, string[] memory _newStrings) external {
        stringArrayDataUser[_key] = _newStrings;
    }

    function addStringArrayDataUser(bytes32 _key, string memory _newString) external {
        stringArrayDataUser[_key].push(_newString);
    }

    // Адресов:
    function setAddressDataUser(bytes32 _key, address _newAddress) external {
        addressDataUser[_key] = _newAddress;
    }

    function setAddressArrayDataUser(bytes32 _key, uint16 _num, address _newAddress) external {
        addressArrayDataUser[_key][_num] = _newAddress;
    }

    function setFullAddressArrayDataUser(bytes32 _key, address[] memory _newAddresses) external {
        addressArrayDataUser[_key] = _newAddresses;
    }

    function addAddressArrayDataUser(bytes32 _key, address _newAddress) external {
        addressArrayDataUser[_key].push(_newAddress);
    }

    // Чисел:
    // Uint8:
    function setUint8DataUser(bytes32 _key, uint8 _newUint8) external {
        uint8DataUser[_key] = _newUint8;
    }

    function setUint8ArrayDataUser(bytes32 _key, uint16 _num, uint8 _newValue) external {
        uint8ArrayDataUser[_key][_num] = _newValue;
    }

    function setFullUint8ArrayDataUser(bytes32 _key, uint8[] memory _newValues) external {
        uint8ArrayDataUser[_key] = _newValues;
    }

    function addUint8ArrayDataUser(bytes32 _key, uint8 _newValue) external {
        uint8ArrayDataUser[_key].push(_newValue);
    }

    // Uint16:
    function setUint16DataUser(bytes32 _key, uint16 _newValue) external {
        uint16DataUser[_key] = _newValue;
    }

    function setUint16ArrayDataUser(bytes32 _key, uint16 _num, uint16 _newValue) external {
        uint16ArrayDataUser[_key][_num] = _newValue;
    }

    function setFullUint16ArrayDataUser(bytes32 _key, uint16[] memory _newValues) external {
        uint16ArrayDataUser[_key] = _newValues;
    }

    function addUint16ArrayDataUser(bytes32 _key, uint16 _newValue) external {
        uint16ArrayDataUser[_key].push(_newValue);
    }

    // Uint:
    function setUintDataUser(bytes32 _key, uint _newValue) external {
        uintDataUser[_key] = _newValue;
    }

    function setUintArrayDataUser(bytes32 _key, uint16 _num, uint _newValue) external {
        uintArrayDataUser[_key][_num] = _newValue;
    }

    function setFullUintArrayDataUser(bytes32 _key, uint[] memory _newValues) external {
        uintArrayDataUser[_key] = _newValues;
    }

    function addUintArrayDataUser(bytes32 _key, uint _newValue) external {
        uintArrayDataUser[_key].push(_newValue);
    }

    // Байтов:

    function setBytes32DataUser(bytes32 _key, bytes32 _newValue) external {
        bytes32DataUser[_key] = _newValue;
    }

    function setBytes32ArrayDataUser(bytes32 _key, uint16 _num, bytes32 _newValue) external {
        bytes32ArrayDataUser[_key][_num] = _newValue;
    }

    function setFullBytes32ArrayDataUser(bytes32 _key, bytes32[] memory _newValues) external {
        bytes32ArrayDataUser[_key] = _newValues;
    }

    function addBytes32ArrayDataUser(bytes32 _key, bytes32 _newValue) external {
        bytes32ArrayDataUser[_key].push(_newValue);
    }

    // Bool:

    function setBoolDataUser(bytes32 _key, bool _newValue) external {
        boolDataUser[_key] = _newValue;
    }

    function setBoolArrayDataUser(bytes32 _key, uint16 _num, bool _newValue) external {
        boolArrayDataUser[_key][_num] = _newValue;
    }

    function setFullBoolArrayDataUser(bytes32 _key, bool[] memory _newValues) external {
        boolArrayDataUser[_key] = _newValues;
    }

    function addBoolArrayDataUser(bytes32 _key, bool _newValue) external {
        boolArrayDataUser[_key].push(_newValue);
    }
    
    // Просмотр данных проекта:
    // Строки:
    function getStringDataProject(bytes32 _key) external view returns (string memory) {
        return stringDataProject[_key];
    }

    function getStringArrayDataProject(bytes32 _key) external view returns (string[] memory) {
        return stringArrayDataProject[_key];
    }

    // Адреса:
    function getAddressDataProject(bytes32 _key) external view returns (address) {
        return addressDataProject[_key];
    }

    function getAddressArrayDataProject(bytes32 _key) external view returns (address[] memory) {
        return addressArrayDataProject[_key];
    }

    // Числа:
    function getUint8DataProject(bytes32 _key) external view returns (uint8) {
        return uint8DataProject[_key];
    }

    function getUint8ArrayDataProject(bytes32 _key) external view returns (uint8[] memory) {
        return uint8ArrayDataProject[_key];
    }


    function getUint16DataProject(bytes32 _key) external view returns (uint16) {
        return uint16DataProject[_key];
    }  

    function getUint16ArrayDataProject(bytes32 _key) external view returns (uint16[] memory) {
        return uint16ArrayDataProject[_key];
    }

    function getUintDataProject(bytes32 _key) external view returns (uint) {
        return uintDataProject[_key];
    }

    function getUintArrayDataProject(bytes32 _key) external view returns (uint[] memory) {
        return uintArrayDataProject[_key];
    }

    // Изменение данных проекта:
    // Строк:
    function setStringDataProject(bytes32 _key, string memory _newString) external {
        stringDataProject[_key] = _newString;
    }
    
    function setStringArrayDataProject(bytes32 _key, uint16 _num, string memory _newString) external {
        stringArrayDataProject[_key][_num] = _newString;
    }

    function setFullStringArrayDataProject(bytes32 _key, string[] memory _newString) external {
        stringArrayDataProject[_key]= _newString;
    }

    function addStringArrayDataProject(bytes32 _key, string memory _newString) external {
        stringArrayDataProject[_key].push(_newString);
    }

    // Адресов:
    function setAddressDataProject(bytes32 _key, address _newAddress) external {
        addressDataProject[_key] = _newAddress;
    }

    function setAddressArrayDataProject(bytes32 _key, uint16 _num, address _newAddress) external {
        addressArrayDataProject[_key][_num] = _newAddress;
    }

    function setFullAddressArrayDataProject(bytes32 _key, address[] memory _newAddress) external {
        addressArrayDataProject[_key] = _newAddress;
    }

    function addAddressArrayDataProject(bytes32 _key, address _newAddress) external {
        addressArrayDataProject[_key].push(_newAddress);
    }

    // Чисел:
    // Uint8:
    function setUint8DataProject(bytes32 _key, uint8 _newUint8) external {
        uint8DataProject[_key] = _newUint8;
    }

    function setUint8ArrayDataProject(bytes32 _key, uint16 _num, uint8 _newValue) external {
        uint8ArrayDataProject[_key][_num] = _newValue;
    }

    function setFullUint8ArrayDataProject(bytes32 _key, uint8[] memory _newValues) external {
        uint8ArrayDataProject[_key] = _newValues;
    }

    function addUint8ArrayDataProject(bytes32 _key, uint8 _newValue) external {
        uint8ArrayDataProject[_key].push(_newValue);
    }

    // Uint16:
    function setUint16DataProject(bytes32 _key, uint16 _newValue) external {
        uint16DataProject[_key] = _newValue;
    }

    function setUint16ArrayDataProject(bytes32 _key, uint16 _num, uint16 _newValue) external {
        uint16ArrayDataProject[_key][_num] = _newValue;
    }

    function setFullUint16ArrayDataProject(bytes32 _key, uint16[] memory _newValues) external {
        uint16ArrayDataProject[_key] = _newValues;
    }

    function addUint16ArrayDataProject(bytes32 _key, uint16 _newValue) external {
        uint16ArrayDataProject[_key].push(_newValue);
    }

    // Uint:
    function setUintDataProject(bytes32 _key, uint _newValue) external {
        uintDataProject[_key] = _newValue;
    }

    function setUintArrayDataProject(bytes32 _key, uint16 _num, uint _newValue) external {
        uintArrayDataProject[_key][_num] = _newValue;
    }

    function setFullUintArrayDataProject(bytes32 _key, uint[] memory _newValues) external {
        uintArrayDataProject[_key] = _newValues;
    }

    function addUintArrayDataProject(bytes32 _key, uint _newValue) external {
        uintArrayDataProject[_key].push(_newValue);
    }

    // Байтов:
    function setBytes32DataProject(bytes32 _key, bytes32 _newValue) external {
        bytes32DataUser[_key] = _newValue;
    }

    function setBytes32ArrayDataProject(bytes32 _key, uint16 _num, bytes32 _newValue) external {
        bytes32ArrayDataUser[_key][_num] = _newValue;
    }

    function setFullBytes32ArrayDataProject(bytes32 _key, bytes32[] memory _newValues) external {
        bytes32ArrayDataUser[_key] = _newValues;
    }

    function addBytes32ArrayDataProject(bytes32 _key, bytes32 _newValue) external {
        bytes32ArrayDataUser[_key].push(_newValue);
    }
}

